(117,4,10,149,'Even though I may have selected other choices the most such as ganging up on task, after reading this whole narrative, I felt that social loafing was the behavior that dominated the narrative the most. Even though the project was a team paper and presentation, teamwork did not seem to present positively. For example, there was Ian who often missed meetings and did not correct and review papers well. Also, there was a person who interrupted another teammate when practicing together as a team for the presentation. In conclusion, through completing this assignment, I learned that teamwork is important and that when there is a person who does not participate well in the team project, we should talk through it and come up with solution to not mess up the team assignment just because of the person. ','2017-09-04 01:09:01','2017-09-05 12:15:47',10,1,''),
