(236,4,12,173,'Even though they had some problems with group work, and there was a crisis at the time, they eventually ended their project successfully as a group.  If they had been more committed to the groups tasks than to their personal work, the team would have been more successful. However, since not every team members can participate equally, I would say that they have accomplished relatively well.','2019-02-26 00:41:54','2019-02-28 00:56:54',25,1,''),
(237,3,6,449,'Each member of the group has to listen to each other and respect what other people say since it is not individual work. In this story, there was too much domination. Anna tried to be a leader which is good but it does not mean that she can ignore other peoples opinion and tell them to follow her opinion. ','2019-02-26 07:28:39','2019-03-03 11:14:20',24,1,''),
(238,3,7,466,'The behavior that best characterizes this group is group domination. Anna, who was the only non-freshmen, dominated the overall group atmosphere. I believe it will be better if Anna should tried to understand and respect others opinions. Furthermore, the other group members should put more efforts on the group project. The group where every members participate actively and have equal chance to share their ideas is an ideal group for team project. ','2019-02-26 09:52:25','2019-03-03 15:12:59',24,1,''),
