(241,3,7,122,'I believe that if Anna listens to other teammates more carefully, other teammates would not hurt their feelings. Also, everyone has their own talents that they can do better in some fields. Therefore, it is important to find out each teammatess talents and encourage them, not blaming.','2019-02-27 02:19:00','2019-03-02 01:16:00',25,1,''),
(242,3,2,438,'one of the group members dominate the group every week.','2019-02-27 02:29:27','2019-03-06 14:20:50',25,1,''),
(243,4,11,434,'I want to choose Social loafing. At the first time, Iain was participating well as he helped the main character. However, as the time went, he was being lazy even though he could be able to put more efforts on his work, and everyone knew it. His under-contribution and laziness run the entire group ragged as they were arguing and raising their voices with each other. Plus, at the final, Iains behavior was obviously stealing the show what group members contributed. Fortunately, Iain agreed to finish up the final draft and gave it to Marie so the result was okay. Even though the result was not bad, this group was not in equal participation but social loafing as Iain was not doing what he supposed to do. Therefore, in order to improve the situation, every group member should be equally participated, and respect each other for bringing about a better result.','2019-02-27 04:42:50','2019-03-03 15:16:08',24,1,''),
(244,3,3,458,'Why dont you keep appointment time and try to do your best at first?','2019-02-27 06:41:30','2019-02-28 12:53:09',24,1,''),
