(246,4,12,442,'I think they should share what they did in real-time by using programs like google document. It can prevent social loafing so everyone can participate with passion.\r\nSomeone can have a situation and cannot participate in the project, but the member should apologize and finish their job.\r\nAll team members need to have a sense of belonging and participate in group work.','2019-02-27 07:05:16','2019-03-02 07:36:48',24,1,''),
(247,2,8,451,'Show more perspectives of others','2019-02-27 10:45:40','2019-03-04 13:17:34',24,1,''),
