(249,4,2,443,'Most of the group members pay just a little attention and think it would be fine. More cooperative behaviors are needed. ','2019-02-28 03:55:09','2019-02-28 13:43:34',24,1,''),
(250,6,1,472,'In the early part of this journal, the negligence of the group and lack of confidence in each other make the atmosphere of the team negative and I think it is a crisis that can appear in the project process. However, in the later part, each team member tried to fix each others problems or supplement points by making changes or understanding each other so that they could fix it at the next meeting. I think that individuals can not carry on their own in the team play. The unity among team members depends on the will of each individual member. I think we should deal with each other with a commitment to one project for the development of the next step. So during the semester, I will first identify me and my team memberss strengths and supplement points, and then try to keep the team atmosphere positively in preparation.','2019-02-28 04:24:07','2019-03-03 17:47:06',24,1,'Understanding and trusting team members / team communication, willingness and unity'),
(251,1,2,191,'I think teamwork is decent most of the time, but some of the group members, for instance, Anika did not come to class without telling that about other group members, so it is good to tell group members before class when someone could not attend the class. moreover, I also think that the personality and characterization of each group members are so different, so show understanding each members studying habit and presentation style would make the team work more efficient. ','2019-02-28 11:01:13','2019-03-03 15:01:48',24,1,''),
(252,4,3,468,'It is hard to say this group worked equally together because each member showed the irresponsible attitude towards group meeting. Being late to the group meeting is the most terrible thing since time is valuable. An individual can think being late for half an hour can be quite forgivable, but awaiter wastes their time. Also, leaving works for someone else is unfair. Working together and helping each other can be the most significant parts as a team. As a result, this group displays satisfy group presentation, but some people showed dissatisfaction due to their unequal tasks. In order to make a satisfactory result as a group, people should show responsible and help each other.','2019-02-28 15:10:55','2019-03-04 14:37:35',24,1,''),
