(265,1,2,464,'I think equal participation is the most important factor of group works. If someone does not do what he or she has to do, then others should deal with it with more works. Since one is already working on it, if the others are trying to cover it, the others should start from the beginning and it is definitely time consuming. Also, if someone works less than the others, there might be complains. Therefore equal participation is the most crucial part of group work','2019-03-03 06:18:09','2019-03-04 03:11:21',24,1,''),
