(271,3,7,467,'Overall, the group seems to like group domination by Anna. The writer, Jose, and Kim consider Annas feeling in every meetings and they couldnt express their opinions even though they have complains. For better results, Anna should listen other group members opinion more carefully and Anna should respects other group members. ','2019-03-04 08:36:23','2019-03-04 16:33:41',24,1,''),
