(276,4,9,461,'Some students just want to get the score without participating in the group project','2019-05-08 02:24:43','2019-05-23 01:52:31',26,1,''),
(277,6,10,432,'Although I have seen lots of problems in the group, especially social loafing or group domination, the most critical problem in this group was the lack of communication. If they have more discussions in more friendly environment (without conflicts), they would have better result with better ending of the group project. Even, I believe the conflict that was basically caused by Iains under-contribution to the project might be resolved if other teammates constantly shares their progress whether they have a group meeting on that day or not. By simply sharing and continuously updating teammates that \"I just finished this part. Please have a look when you have some time before we move on\" can encourage everyone to work on the project and to contribute something for the project. The attire problem at the presentation is very basic conflict, which should not happen to the professionals (wearing a formal attire at the formal presentation is a common sense), but that actually happened because no one reminded and discussed about it, which clearly shows the lack of attention to the group project. What if they have more communications and more friendly atmosphere so that they talk about every single tasks although it is very trivial? Although it would require more time to discuss, it would definitely prevent such terrible situations at the presentation.','2019-05-09 08:48:26','2019-05-23 08:11:42',26,1,'Lack of communication'),
(278,6,1,472,'This is a reflection of a part of the whole story, but I mean that the whole team is harmonized based on a thorough understanding of the overall activities and tasks should be used as a process that can be approached to the positive goal that is expected, rather than encouraging or inducing the formation of team members competition. ','2019-05-10 08:16:37','2019-05-10 17:16:02',26,1,'Care of team members Expectations of development through competitive structure, The positive reaction and action of several team members, the need for harmony, Project Proper Distribution, social loafing, Positive looks and expectations for goals'),
(279,3,6,173,'The group somehow completed their work adequately. However, all the work they have done do not seem to get agreements from all members but seem to reflect a persons idea. Also, almost all the peer evaluation that has done around this group is focused on only one person so that the person seems to dominate the whole group. Even though the person has more experience or insights than others, making the only opinion from a person can be dangerous. So I think this group needs to spend more time to go over each team members opinion and thoughts. Having additional 5-10 minutes for each meeting to talk and share what each member thinks would be helpful for this team.','2019-05-12 14:57:27','2019-05-12 15:59:28',27,1,''),
(280,4,4,443,'The narrator should focus on his or her group projects rather than his or her personal tasks while doing certain group projects. The narrator tends to pretend that he or she is doing, but actually doing nothing. More of equal participations needed. ','2019-05-14 13:10:22','2019-05-25 06:27:34',26,1,''),
