(294,3,4,191,'even though it looks like every team members are equally participated, Anika was not really participating, and her work should be done by other teammates. and also not every member are not responsible for the team meeting. they are not taking seriously such as they were late for team meeting but did not felt sorry about the other members. ','2019-05-24 00:42:30','2019-05-24 01:11:42',26,1,''),
