(296,1,12,435,'Good','2019-05-24 15:00:36','2019-05-24 15:02:34',27,1,'Great team members'),
(297,3,7,466,'It will be better if all group members participated in the project actively, as much as Anna did. As Anna was the person who spent most of her time in organizing and making progress on group activities, she sometimes speaks in a commanding tone and devalues the contribution of others. It would be better if she respects others ideas and encourages them to work harder. For other group members, it would be better if they also participated in organizing and checking requirements for the project. Each group members contribution toward the group project - including organizing, understanding requirements, suggesting ideas, producing, and performing tasks, should be equal.  ','2019-05-26 04:26:19','2019-05-26 08:02:34',26,1,''),
(298,NULL,2,440,NULL,'2019-05-27 06:37:52','2019-05-27 06:37:52',26,1,NULL),
(299,3,6,116,'In overall, this group had various situations. Anna, was mostly the one that led the group work progress, however, it often gave negative effects. My suggestion is, when forming a group, it is a good idea to have one experienced leader such as Anna, but in order to cooperate smoothly, it is better to work with members in same level. ','2019-05-27 06:40:48','2019-05-29 06:13:15',26,1,''),
(300,1,5,446,'She needs to chill and be patient with other members paces. Everyone has a different level of expectation and work style, so she needs to respect that before she criticizes. I feel like she has no respect for other group members, and she thinks she is in a higher position than the others because she has more experience. That attitude has to change. ','2019-05-27 07:08:29','2019-05-28 04:29:25',26,1,''),
