(315,5,5,519,'While reading this, the narrater made me feel stressed. I feel that she was controlling and judgmental towards her group. Although they sometimes werent on time or had things done the way she thought wasnt right, they still were trying their best and doing the work. To improve this I would express to her how she made the group feel and talk to the teacher about the issues they were having. ','2019-08-27 17:43:59','2019-09-01 16:16:23',29,1,''),
