(325,3,1,551,'I think better communication would have helped the group tremendously. They seemed to not always be on the same page and sometimes would make major changes without letting everybody else know. I think it should have been mentioned that they were going to make these changes and then they can review them together.','2019-08-27 19:21:19','2019-08-29 02:04:19',28,1,''),
(326,4,3,540,'From what I read it seems like there wasnt a lot of team work. A team member was usually taking charge and not everyone would agree. Often people would not even show up to practice. I would suggest them to meet at times where it would work out for everyone. Also, I noticed that when someone had an idea, someone would just throw it under the rug. I think if everyone used everyones idea, their project would have turned out better. They definitely should have practiced more!','2019-08-27 19:21:57','2019-08-31 00:03:22',28,1,''),
