(359,NULL,4,546,'Overall, I believe the narrative was done well. Maybe in the future there can be more group domination or social loafing added to the text just to make it a bit different and more challenging to read.','2019-11-24 20:31:03','2019-11-29 22:20:31',31,1,'Most of the time the group worked well together, which was equal participation. But, on some of the days there was group domination, one person would take more of a role than the others .'),
