(362,1,12,538,'Even though the author mostly showed equal participation, the narrator demonstrated some social loafing. However, the author can prevent this by creating a schedule to help her manage her time better.','2019-11-29 21:29:13','2019-11-29 21:52:57',31,1,''),
(363,3,8,555,'How well did this group do in the end?','2020-01-24 00:49:01','2020-01-26 01:02:15',34,1,''),
(364,5,10,607,'Interesting scenario. I believe Iain was a strong contributor at the beginning of the semester, but definitely disregarded some of his responsibilities. Throughout this narrative it seemed as if this individual had some sort of bias/attitude towards Iain after she questioned his family emergency. Every situation afterwards contained digs towards Iain. I can definitely recognize Iains lack of participation some weeks but I do not believe some of the comments were fair as he lead the charge in the beginning when others struggled. The narrative portrayed John and Hannah as contributors; John being the stronger of the two. Hannahs openness in receiving feedback was nice to see as some cannot take constructive criticism. \r\n\r\nI would like to have the ability to navigate through the scenarios. Some of the scenarios were unclear and met multiple behaviors in my opinion. It was sometimes difficult to discern the overarching behavior in some of the narratives.','2020-01-24 22:32:49','2020-01-24 23:53:08',34,1,''),
(365,3,7,562,'Maybe make the entries more short and to the point, many of them were very obscure and tedious ','2020-01-25 20:35:51','2020-01-25 20:44:38',34,1,''),
(366,4,1,610,'I feel like the narrative always wanted to do their part most. But at other times there would be days that the narrative wouldnt do as much work as if they worked by themselves. I feel like the narrative should take time to time manage and figure out everyones schedule to actually meet and give feedback.','2020-01-26 02:37:57','2020-01-28 17:27:55',34,1,''),
(367,3,6,608,'Overall the group was good. Anna was a needed leader but she was too bossy. Everyone seemed to give in their efforts.','2020-01-26 03:32:27','2020-01-26 04:14:49',34,1,''),
(368,NULL,12,606,NULL,'2020-01-26 20:12:05','2020-01-26 20:12:05',34,1,NULL),
(369,6,3,566,'I would say the narrative was pretty well written and showed all different types of behaviors that often occur in a group project.','2020-01-27 00:09:57','2020-01-28 03:53:43',34,1,'I saw many different behaviors throughout the narrative.  It is hard to pick just one since it was based off of 13 weeks.'),
(370,3,9,612,'The group has to work better together and try to contribute as much as they can. It is not okay that half of the group is doing a lot of work and the other half does nothing. The group should also have better communication skills and give a better notice if they are not going to be at the meetings.','2020-01-27 01:51:04','2020-01-27 02:56:55',34,1,''),
(371,4,5,605,'I am not really sure how you could improve on the narrative. I feel as though each entree was detailed and gave a few opportunities to display the types of behaviors. ','2020-01-27 02:51:32','2020-01-27 03:11:34',34,1,''),
